import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
// import "./index.css";
import Sdata from "./Sdata";
ReactDOM.render(
  <>
    <h1>Netflix Top 10 Series</h1>
    <Card
      sname={Sdata[0].sname}
      imgSrc={Sdata[0].imgSrc}
      title={Sdata[0].title}
      link={Sdata[0].link}
      rating={Sdata[0].rating}
    />

  </>,
  document.getElementById("root")
);
